import styled from 'styled-components';

const ProductsMainPageStyles = styled.section`
  margin-top: 8rem;
  padding-left: 5rem;
  padding-right: 5rem;
  h2 {
    font-size: 4rem;
    text-transform: uppercase;
    font-weight: 400;
  }
`;

const ProductMainPageStyles = styled.div`

`;

export { ProductsMainPageStyles };
